import "../stylesheets/CardList.scss";
import Card from "./Card";

const CardList = (props) => {
  return (
    <ul>
      <Card
        src="https://img.europapress.es/fotoweb/fotonoticia_20110426171734_420.jpg"
        alt="Poly Styrene"
        title="Poly Styrene"
      />
    </ul>
  );
};

export default CardList;
